status_message:
You're invited to join TIME's special Veterans Day Twitter chat on Friday, Nov. 11 at 2:30 EST. 

This Veterans Day, TIME will host a special discussion about the disconnection of U.S. military veterans and American society, focusing on the unemployment, a poor healthcare system and the social stigma of today's veterans. To participate, join us on Twitter from 2:30 to 3:30 EST Friday afternoon, and make sure to include the hashtag, #TIMEVets, in all of your tweets. 

Leading the chat from TIME will be: 

@Jim_Frederick
International editor and author of "Black Hearts," Jim Frederick

@MarkThompson_DC
Pulitzer-prize winning TIME Pentagon correspondent Mark Thompson

@naterawlings
Reporter and Iraq War veteran Nate Rawlings
